var recordatorioUrl=global_settings.urlCORS+"api/recordatorioapi/";registrationModule.factory("recordatorioRepository",function(r){return{get:function(){return r.get(recordatorioUrl+"0-0")},getByEmpleado:function(o){return r.get(recordatorioUrl+"1-"+o)},actualizar:function(o,t){return r.get(recordatorioUrl+"2-"+o+"-"+t)},eliminar:function(o){return r.get(recordatorioUrl+"3-"+o)},add:function(o,t){return r.post(recordatorioUrl+o+"-idContrato-"+t)},"delete":function(){return r["delete"](recordatorioUrl)},put:function(o){return r.put(recordatorioUrl,o)}}});